import React, { useState } from 'react';
import { Container, Navbar, Nav } from 'react-bootstrap';
import GoogleMapComponent from './GoogleMapComponent';
import { LoadScript, StandaloneSearchBox } from '@react-google-maps/api';

function Home() {
  const [destination, setDestination] = useState(null);
  const [currentLocation, setCurrentLocation] = useState({ lat: 37.7749, lng: -122.4194 }); // Default to San Francisco

  const handlePlacesChanged = (searchBox) => {
    const places = searchBox.getPlaces();
    if (places.length === 0) {
      return;
    }
    const place = places[0].geometry.location;
    setDestination(place);
  };

  return (
    <div>
      <Navbar bg="dark" variant="dark">
        <Navbar.Brand href="#home">Medical Services</Navbar.Brand>
        <Nav className="me-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#services">Services</Nav.Link>
          <Nav.Link href="#contact">Contact</Nav.Link>
        </Nav>
      </Navbar>
      <Container className="p-5">
        <h1>Welcome to Medical Services</h1>
        <p className = "thank-you-p">Thank you for using our service. We look forward to assisting you.</p>
        <LoadScript
          googleMapsApiKey="AIzaSyDuBX2b6y-SpGeuj7KFSgBTrxBoJpV3VQA"
          libraries={["places"]}
        >
          <StandaloneSearchBox
            onLoad={ref => ref && console.log('SearchBox loaded')}
            onPlacesChanged={() => handlePlacesChanged(this)}
          >
            <input
              type="text"
              placeholder="Enter a location"
              className="form-control mb-3"
            />
          </StandaloneSearchBox>
        </LoadScript>
        <GoogleMapComponent origin={currentLocation} destination={destination} setDestination={setDestination} />
      </Container>
    </div>
  );
}

export default Home;
